const NavBar = ({ getData }) => {
  return (
    <>
      <div id="navBar">
        <div id="navbarDiv">
          <h1>LGM task2 </h1>
          <button onClick={getData}>click to get data</button>
        </div>
      </div>
      <div id="emptyData">
        <h1>No Users Found</h1>
        {/* <div id="underLine"></div> */}
      </div>
    </>
  );
};

const NavBarSecond = ({getData}) => {
  return (
    <>
      <div id="navBar">
        <div id="navbarDiv">
          
          <button onClick={getData}>Get Users</button>
        </div>
      </div>
    </>
  );
};

export { NavBar,NavBarSecond };
